import React from 'react'
import styled from 'styled-components'
import './Style.scss'

const Header = styled.div`
    display : flex;
    flex-direction : column;
    width : 100%;
`
const HeaderNav = styled.div`
    display : flex;
    flex-direction : row;
    align-items : center;
    padding : 20px 50px;
    background-color: black;
`;

const BtnBack = styled.button`
    background-color: transparent;   
    color : white;
    border: none;
    outline: none;
    cursor : pointer;
    &:active {
        border : none;
    }
`

class App extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render() {
        return (
            <Header>
                <HeaderNav>
                    <BtnBack>
                        <i className="material-icons md-dark">arrow_back</i>
                    </BtnBack>
                </HeaderNav>
            </Header>
        )
    }
}

export default App
